script: |
  super -f text -I q5434.spq | sort > q5434.out

inputs:
  - name: q5434.spq
    data: |
      SELECT DISTINCT - + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - ( - col0 ) - - col2 NOT IN ( - + ( + + col1 ) * + - 15 + + 88 + - + col2 + + col0 + + + col2 * + - 0 + - col0, - col0, - col2 * - 24 );
  - name: tab1

outputs:
  - name: q5434.out
    data: |
